import React from "react";
import './Home.css';
import Backgroundvideo from "../../Components/Backgroundvideo/Backgroundvideo";
import Introductiontothesubject  from "../../Components/Introductiontothesubject/Introductiontothesubject";
import Fashion from "../../Components/Fashion/Fashion";
import srcimage1 from './../../photos/coat.jpg';
import srcimage2 from './../../photos/white_hoodie_mockup.jpg';

const Homepage = () => {
    return (
        <div className="HomePage">
            
            <div className="background1">
                    <Backgroundvideo/>
                    <Introductiontothesubject>
                        <h1>Have The Best With US...</h1>
                        <h2>Create your best style here...</h2>
                    </Introductiontothesubject>
            </div>
                    <Fashion>
                        <div className="leftsidebox">
                            <div className="imagebox">
                                <img src={srcimage1} alt="321"/>
                            </div>
                            <div className="imagebox">
                                <img src={srcimage2} alt="312"/>
                            </div>
                        </div>
                        <div className="rightsidebox"></div>
                    </Fashion>       
                          
        </div>
    )
}
export default Homepage
